import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Locate and click the cart button
    const cartButtonLocator = page.locator('div.cart');
    await cartButtonLocator.waitFor({ state: 'visible', timeout: 5000 });
    await cartButtonLocator.click();

    // Wait for the modal to become visible
    // Based on the provided JS, a modal is displayed, we assume it has the class 'modal' from the CSS
    const modalLocator = page.locator('.modal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal is open and has content
    const isModalVisible = await modalLocator.isVisible();
    const modalHeaderText = await page.locator('.cart-content h2').textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        isModalVisible: isModalVisible,
        modalHeaderText: modalHeaderText.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to open the shopping cart modal",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
